from __future__ import annotations
import logging
from pathlib import Path
from subprocess import run
from typing import Sequence


def ls_files(*patterns: str) -> list[str]:
    proc = run(['git', 'ls-files', '--', *patterns], capture_output=True)
    return proc.stdout.decode('utf-8').split('\n')


def ls_modules(*, skip_prefixes: Sequence[str] = [], skip_main: bool = True) -> list[str]:
    modules = ls_files('src/bokeh/*.py')
    module_list = []

    for module in modules:
        module_name = module.replace('src/', '').replace('.py', '').replace('/', '.')

        if skip_main and module_name.endswith('__main__'):
            continue

        if any(module_name.startswith(prefix) for prefix in skip_prefixes):
            continue

        module_list.append(module_name)

    return module_list
